import React from 'react';
import '../styles/Progressbar.css';

function Progressbar(props) {

    const ratingCalculation = () => {
        console.log('code....');
        var rating = parseInt(props.rating);
        var percentage = rating * 10;
        return { 'width': percentage + 'em' }
    }

    return (
        <>
            {!isNaN(parseFloat(props.rating)) ?
                <div className='progress-bar'>
                    <div className='filled' style={{ 'width': () => ratingCalculation }}></div>
                </div> : props.rating
            }
        </>
    )
}

export default Progressbar
